def in_office(verb, noun):
    state = "in_office"
    if(verb == "look"):
        if(noun == "around"):
            print("""You are now in the office. You can call any one of your 
classmates, you can go nurse which will bring you to the nurses office, you can 
make announcement, you can also leave office.""")
    if(verb == "call"):
        if(noun == "jason"):
            print("Jason is playing basketball. He can't pick up the phone")
        elif(noun == "leo"):
            print("leo is fixing machines. Don't ask. He can't pick up the phone")
        elif(noun == "frank"):
            print("Frank is in detention. Go away.")
        elif(noun == "percy"):
            print("percy is helping leo with stuff. Don't ask. He can't pick up the phone")
        elif(noun == "octavian"):
            print("octavian is on the floor. Don't ask. He can't pick up the phone")
        elif(noun == "annabeth"):
            print("annabeth is talking architecture. Don't ask. She can't pick up the phone")
        elif(noun == "hazel"):
            print("Hazel is calling other people. Don't ask.She can't pick up the phone")
        elif(noun == "reyna"):
            print("reyna is cackling. Don't ask. He can't pick up the phone")
        elif(noun == "nico"):
            print("Nico is performing a ritual. Don't ask. He can't pick up the phone")
        elif(noun == "will"):
            print("Will is going over medical stuff. Don't ask. He can't pick up the phone")
        elif(noun == "piper"):
            print("Piper is fixing her hair. Don't ask. She can't pick up the phone")
        else:
            print("I don't have " + noun + "'s number")
    elif(verb == "make"):
        if(noun == "announcement"):
            print("""An office lady is near it. Better not do that if you don't want to get in trouble.""")
    elif(verb == "leave"):
        if(noun == "office"):
            print("You are now in the lobby.")
            state = "in_lobby"
    elif(verb == "go"):
        if(noun == "nurse"):
            print("You are now in the nurse's office. You can take medicine, cast teacher (if you have a staff), and leave nurse to leave the room and enter the offices again.")
            state = "in_nurse's_office"
    else:
        print("wut")
    return state

