def outside(verb, noun):
    state = "outside"
    if(verb == "look"):
        if(noun == "around"):
            print("""You are outside. You can go inside, destroy school, and 
leave school. But be careful if you leave the school. A teacher might find 
you and put you in detention.""")
    elif(verb == "destroy"):
        if(noun == "school"):
            if(event_flags["staff_obtained"] == True):
                print("""You have destroyed the school. Congrats. you won the game""")
                state = "game_won"
            else:
                print("You don't have the all powerful staff. Try going to the gym, completing all the quests and talking to hazel.")
